import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import styled from 'styled-components/native';

const SC = {
    Container: styled.View`
        flex: 1;
        background-color: #FFFFFF;
        padding: 25px;
    `,
    storeName: styled.Text`
        font-family: Bold;
        font-size: 20px;
        margin-bottom: 15px;
    `,
    storeInfoWrap: styled.View`
        flex-Direction: row;
        justify-Content: space-between;
        margin-Bottom: 10px;
    `,
    storeInfoTitle: styled.Text`
        font-Family: Regular;
        font-Size: 12px;
        color: gray;
    `,
    storeInfoText: styled.Text`
        font-Family: Meduim;
        font-Size: 12px;
        color: gray;
    `
}

const StoreInfoTap = () => {
    const storeInfo =
    {
        storeName: "맛사랑",
        storeTel: "032-860-1234",
        storeDayOff: '매일',
        storeOpenTime: '09:00',
        storeCloseTime: '20:00',
        storePriceRange: '1만원 이하',
        storeLoaction: '인천광역시 미추홀구 인주대로 123번길 20'
    }

    return (
        <SC.Container>
            <SC.storeName>{storeInfo.storeName}</SC.storeName>
            <SC.storeInfoWrap>
                <SC.storeInfoTitle>전화번호</SC.storeInfoTitle>
                <SC.storeInfoText>{storeInfo.storeTel}</SC.storeInfoText>
            </SC.storeInfoWrap>
            <View style={styles.storeInfoWrap}>
                <Text style={styles.storeInfoTitle}>휴무일/영업시간</Text>
                <Text style={styles.storeInfoText}>{storeInfo.storeDayOff} / {storeInfo.storeOpenTime} ~ {storeInfo.storeCloseTime}</Text>
            </View>
            <View style={styles.storeInfoWrap}>
                <Text style={styles.storeInfoTitle}>가격대</Text>
                <Text style={styles.storeInfoText}>{storeInfo.storePriceRange}</Text>
            </View>
            <View style={styles.storeInfoWrap}>
                <Text style={styles.storeInfoTitle}>주소</Text>
                <Text style={styles.storeInfoText}>{storeInfo.storeLoaction}</Text>
            </View>
            <View style={styles.storeMapWrap}>
                <Text style={styles.storeInfoTitle}>지도</Text>
            </View>
        </SC.Container>
    );
}


const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#FFFFFF',
        padding: 25
    },
    storeName: {
        fontFamily: 'Bold',
        fontSize: 20,
        marginBottom: 15
    },
    storeInfoWrap: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        marginBottom: 10
    },
    storeInfoTitle: {
        fontFamily: 'Regular',
        fontSize: 12,
        color: 'gray'
    },
    storeInfoText: {
        fontFamily: 'Meduim',
        fontSize: 12,
        color: 'gray'
    }
});

export default StoreInfoTap;
